const removeBoundariesForAllOtherCities = () => {
    map.off();
    map.remove();
    map = L.map('map', {
        layers: MQ.mapLayer(),
        center: [21.146633, 79.088860],
        zoom: 6
    });
}
city.map((cities) => {
    var marker = L.marker([cities[1], cities[2]]);
    marker.addEventListener('mouseover', () => {
        marker.bindPopup(`${cities[0]}<br>`).openPopup();
    })
    marker.addEventListener('click', handleClick);

    function handleClick() {
        removeBoundariesForAllOtherCities();
        let city = boundary[cities[0]]
        city.map((a) => {
            a.reverse()
        })
        var polyline = L.polygon(city, {
            color: 'gray',
            weight: 3,
            smoothFactor: 1,
            opacity: 1
        }).addTo(map);

        map.fitBounds(polyline.getBounds());
        city.map((a) => {
            a.reverse()
        })
    }
    marker.on('click', handleClick);
});

const drawBoundary = () => {
    removeBoundariesForAllOtherCities();
    let cityVal = '';
    city.map((cities) => {
        var enteredValue = document.getElementById('enteredCity').value.toLowerCase().trim();
        if (cities[0].toLowerCase().includes(enteredValue)) {
            cityVal = cities[0];
            L.marker([cities[1], cities[2]]).addTo(map).bindPopup(`${cities[0]}<br>`).openPopup();
        }
    });
    if (cityVal == '') {
        window.alert('Enter a valid city name');
        document.getElementById('enteredCity').value = '';
    } else {
        let city = boundary[cityVal];
        city.map((a) => {
            a.reverse()
        });
        var polyline = L.polygon(city, {
            color: 'gray',
            weight: 3,
            smoothFactor: 1,
            opacity: 1
        }).addTo(map);
        map.fitBounds(polyline.getBounds());
        city.map((a) => {
            a.reverse()
        })
    }
}
document.getElementById('findButton').addEventListener('click', () => drawBoundary());
document.getElementById('enteredCity').addEventListener('keypress', function (e) {
    if (e.key === 'Enter') {
        drawBoundary();
    }
    
});

